import { Box, Typography } from "@mui/material";
import React from "react";
import { Img } from "../Images/Img";
import LogoPng from "../../images/logo_aurora-06.png";

export const Logo = () => {
  const altLogo = "logoHeader";
  const sizeLogo = "50px";

  return (
    <>
      <img src={LogoPng} alt={altLogo} width={sizeLogo} height={sizeLogo} />
    </>
  );
};



